  const handleData = async (e) => {
    e.preventDefault();
    const data = userForm();
    setLoadingData(data);
  };

  return (
    <div className={css6.card}>
      <h3>Task 6</h3>
      <ul></ul>
      <button onClick={handleData}>check</button>
    </div>
  );
}

